import React from 'react'
import Button from './Button'

const Cards = ({post}) => {
  return (
    <div className='bg-red-200'>
      <p>{post.title}</p>
      <img src="" alt="" />
      <p>{post.desc}</p>
      <p>{Button}</p>
    </div>
  )
}

export default Cards
